    "2016-09-01T12:03:37.887502",nt"name": "language-assistance-program",nt"isopen":
    false,nt"url": null,nt"notes": "Each person who files bankruptcy is required
    to attend a meeting of creditors and respond to questions under oath from the trustee
    and creditors. The meetings are held nationwide. In those locations where the room
    is controlled by the USTP, if a participant (debtor or creditor) has limited English
    proficiency, an interpreter is provided free of charge via a conference phone. The
    number and type of languages interpreted, along with the location where the service
    was provided, is collected monthly by the USTP for oversight, billing, and statistical
    purposes. Data are provided in delimited text files. Each entry represents one interpreting
    session, which may include more than one case.",nt"license_title": "License
